// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";


contract PixelPuckPlayer is ERC721, Ownable {

    uint dnaDigits = 28;
    uint dnaModulus = 10 ** dnaDigits;
    
    event NewPlayer(uint indexId, uint offence, uint defence, uint dna, uint playertype);

    struct Player{
        uint offence;
        uint defence;
        uint dna;
        uint playertype;
        uint teamId;
        uint jerseyId;
        uint mainColor;
        uint injuryTimestamp;
        uint injuredTime;
    }

    uint nextId = 0;

    mapping (uint => Player ) private _tokenDetails;

    constructor(string memory name, string memory symbol) ERC721("Pixel Puck Player", "PPP"){

    }

    function getTokenDetails(uint tokenId) public view returns (Player memory){
        return _tokenDetails[tokenId];
    }

    function _generateRandDna () private view returns (uint){
        uint rand = uint(keccak256(abi.encodePacked(block.timestamp, block.difficulty, msg.sender)));
        return rand % dnaModulus;
    }

    function _generateRandPrimaryAtrrib () private view returns (uint){
    uint primaryAttrib =  uint(keccak256(abi.encodePacked(block.difficulty, block.timestamp % 7, msg.sender))) % 50;
    return primaryAttrib + 50;
    }

    function _generateRandSecondaryAtrrib () private view returns (uint){
    uint secondaryAttrib =  uint(keccak256(abi.encodePacked(block.timestamp, msg.sender))) % 50;
    return secondaryAttrib;
    }

    function _generateRandGoalieDefence () private view returns (uint){
    uint secondaryAttrib =  uint(keccak256(abi.encodePacked(block.timestamp, block.difficulty, msg.sender))) % 25;
    return secondaryAttrib + 75;
    }

    function mintOffence() public onlyOwner {
        uint offenceScore = _generateRandPrimaryAtrrib();
        uint defenceScore = _generateRandSecondaryAtrrib();
        uint playerDna = _generateRandDna();
        uint playerType = 1;
        _tokenDetails[nextId] = Player(offenceScore, defenceScore, playerDna, playerType,0,0,0,0,0);
        _safeMint(msg.sender, nextId);
        emit NewPlayer(nextId, offenceScore, defenceScore, playerDna, playerType);
        nextId++;
    }

    function mintDefence() public onlyOwner {
        uint offenceScore = _generateRandSecondaryAtrrib();
        uint defenceScore = _generateRandPrimaryAtrrib();
        uint playerDna = _generateRandDna();
        uint playerType = 2;
        _tokenDetails[nextId] = Player(offenceScore, defenceScore, playerDna, playerType,0,0,0,0,0);
        _safeMint(msg.sender, nextId);
        emit NewPlayer(nextId, offenceScore, defenceScore, playerDna, playerType);
        nextId++;
    }

    function mintGoalie() public onlyOwner {
        uint offenceScore = 0;
        uint defenceScore = _generateRandGoalieDefence();
        uint playerDna = _generateRandDna();
        uint playerType = 3;
        _tokenDetails[nextId] = Player(offenceScore, defenceScore, playerDna, playerType,0,0,0,0,0);
        _safeMint(msg.sender, nextId);
        emit NewPlayer(nextId, offenceScore, defenceScore, playerDna, playerType);
        nextId++;
    }

    // function assignToTeam(uint _tokenId, uint _teamId) public onlyOwner {
    //    Player storage player =  _tokenDetails[_tokenId]._teamId;
    // }
    
    function tokenByIndex(uint256 _index) external view returns (uint256) {
            
    
    }

    function getAllTokensForUser(address user) public view returns (uint256[] memory){
        uint256 tokenCount = balanceOf(user);
        if(tokenCount == 0){
            return new uint256[](0);
        }
        else{
            uint[] memory result = new uint256[](tokenCount);
            uint256 totalPlayers = nextId;
            uint256 resultIndex = 0;
            uint256 i;
            for(i = 0; i < totalPlayers; i++){
                if(ownerOf(i) == user){
                    result[resultIndex] = i;
                    resultIndex++;
                }
                
            }
            return result;
        }
    }

}
